function D2D_Loader(){this.resFinished=[];this.resWaiting=[];}D2D_Loader.prototype.load=function(a,b){var c=new a(b);this.resWaiting.push(c);return c;};D2D_Loader.prototype.add=function(c,a,b){if(c==undefined||c==null||c.isReady==undefined){c=new a(b);}this.resWaiting.push(c);};D2D_Loader.prototype.update=function(){if(this.resWaiting.length>0){for(var a=0;a<this.resWaiting.length;a++){if(this.resWaiting[a].isReady()){this.resFinished.push(this.resWaiting[a]);this.resWaiting.splice(a,1);break;}}}};D2D_Loader.prototype.updateProgress=D2D_Loader.prototype.update;D2D_Loader.prototype.getProgress=function(b){var a=Math.floor((this.resFinished.length/(this.resFinished.length+this.resWaiting.length))*100);if(b==true){return a;}else{return a/100;}};D2D_Loader.prototype.clear=function(){this.resFinished.splice(0,this.resFinished.length);this.resWaiting.splice(0,this.resWaiting.length);};D2D_Loader.prototype.dispose=function(){this.resFinished.splice(0,this.resFinished.length);this.resWaiting.splice(0,this.resWaiting.length);this.resFinished=null;this.resWaiting=null;};